}
            }

            .contact-card {
                flex-basis: 350px;
                background-color: #777777;
                box-shadow: 0px 10px 50px rgba(255, 0, 0, 0.2);
                margin: 10px;
                padding: 1px;
                text-align: center;
                border-radius: 10px;
                border: 1px solid #333333;
                cursor: pointer;
                transition: box-shadow 1.0s ease;
            }

            .contact-card:hover {
                box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.4);
            }

            .contact-card img {
                width: 90%;
                height: 40px;
                margin-bottom: 10px;
            }

            .contact-card h2 {
                margin-top: 0;
                font-size: 18px;
            }

            .contact-card p {
                margin: 8px 0;
                font-size: 14px;
            }

            .contact-card .details {
                display: none;
                text-align: left;
                margin-top: 20px;
                padding-top: 10px;
                border-top: 3px solid #dddddd;
                font-size: 12px;
            }

            .contact-card.expanded .details {
                display: block;
            }
        </style>
        <script>
            function toggleDetails(card) {
                card.classList.toggle("expanded");
            }
        </script>
